import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a visible product card (use text selector for "Add to Cart")
    await page.waitForSelector('button:has-text("Add to Cart")', { timeout: 5000 });

    // Rapidly add multiple products to cart by clicking several "Add to Cart" buttons in succession
    const addToCartButtons = await page.$$('button.add-to-cart');
    let addCount = 0;
    for (let i = 0; i < Math.min(4, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      addCount++;
    }

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_added.png'));

    // Open the cart (find the cart div by text "Cart" and click)
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.click('div.cart');

    // Wait for cart modal to appear (look for Proceed to Checkout button)
    await page.waitForSelector('button.checkout-btn', { timeout: 5000 });

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal.png'));

    // Rapidly increase/decrease quantity of first cart item (use quantity "+" and "-" buttons)
    // Wait for at least one cart-item and its quantity buttons
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    const plusBtn = await page.$('.cart-item button.quantity-btn:nth-of-type(2)');
    const minusBtn = await page.$('.cart-item button.quantity-btn:nth-of-type(1)');
    if (plusBtn && minusBtn) {
      // Click "+" 3 times
      for (let i = 0; i < 3; i++) {
        await plusBtn.click();
      }
      // Click "-" 2 times
      for (let i = 0; i < 2; i++) {
        await minusBtn.click();
      }
    }

    // Take screenshot after quantity changes
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_quantity_changed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_quantity_changed.png'));

    // Remove the first cart item (find "Remove" button in first .cart-item)
    const removeBtn = await page.$('.cart-item button.remove-item');
    if (removeBtn) {
      await removeBtn.click();
    }

    // Take screenshot after removal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_item_removed.png'));

    // Extract cart total and number of items left
    let cartTotal = null;
    let cartItemsCount = 0;
    try {
      cartTotal = await page.$eval('#cartTotal', el => el.textContent.trim());
    } catch {}
    try {
      cartItemsCount = await page.$$eval('.cart-item', els => els.length);
    } catch {}

    return {
      success: true,
      action: "Performed rapid add-to-cart, quantity changes, and removal for stress test. Cart state extracted.",
      extractedData: {
        cartTotal,
        cartItemsCount,
        addCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
